import React from 'react'

const ProductPanierCard = ({product}) => {
  const totalPrice = product.price * product.quantity;
  return (
    <div style={styles.card}>
      <img style={styles.image} src={product.poster} alt="Product not found" />
      <div style={styles.info}>
        <p style={styles.description}>{product.description}</p>
        <p style={styles.price}>Price: {product.price} Dt</p>
        <p style={styles.quantity}>Quantity: {product.quantity}</p>
        <p style={styles.total}>Total: {totalPrice} Dt</p>
      </div>

    </div>
  )
}

export default ProductPanierCard
